import { assets } from "./data";
import AssetsVolume from "./AssetsVolume";

const totalArray = Object.keys(assets).map((item) =>
  AssetsVolume(assets[item])
);

const total = () => {
  totalArray.reduce((acc, item) => {
    return acc + item;
  }, 0);
};

export default total;
